              label="Days"
              placeholder="Days"
              text={respiratory.rhinorrheaDays}
              setText={(text) => {
                setRespiratory({ rhinorrheaDays: text });
              }}
            />
          </FitTextToCell>
        </Col>
        <Col style={styles.headerLightGray}>
          <Text>Sneezing</Text>
