        <Col>
          <FitTextToCell>
            <Input
              label="Days"
              placeholder="Days"
              text={respiratory.badBreathDays}
              setText={(text) => {
                setRespiratory({ badBreathDays: text });
              }}
            />
          </FitTextToCell>
        </Col>
        <Col style={styles.headerLightGray}>
          <Text>Chest tightness</Text>
        </Col>
        <Col>
          <SimpleQuestion
            options={["yes", "no"]}
